class UserRegister extends Command {

    /**
     * The console command name.
     *
     * @var string
     */
    protected $name = 'user:register';

    /**
     * The console command description.
     *
     * @var string
     */
    protected $description = 'Display an inspiring quote';

    /**
     * Execute the console command.
     *
     * @return mixed
     */
    public function handle()
    {
        $this->comment(date('Y-m-d H:i:s') ." - user:register start!");

        //\DB::statement('truncate tb_user_account');
        foreach ( $this->_insertSqls() as $value ) {
            try {
                \DB::statement($value);
            } catch (\Eception $e) {

            }
        }

        $this->comment(date('Y-m-d H:i:s') ." - user:register hash password start!");

        // 削除対象も含める（元データにdeleted_atに日付が張っているため）
        $users = UserAccount::withTrashed()->get();

        foreach ( $users as $user ) {
            $user->password = \Hash::make($user->password);
            $user->deleted_at = null;
            $user->created_by = '001';
            $user->updated_by = '001';
            $user->update();
        }
        
        $this->comment(date('Y-m-d H:i:s') ." - user:register end!");
    }

